import React from "react";
import "./App.css";
import NavBar from "./components/navbar";
import Counters from "./components/counters";

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <main className="container">
        <Counters />
        <Counters />
        <Counters />
      </main>
    </React.Fragment>
  );
}

export default App;
